/*Artefactum custom login*/
function artefactum_login() {
	global $scrwidth;
	$scrwidth = '<script>document.write(window.innerWidth); </script>';	
	if ($scrwidth <= 1280) {$artemargin2 = 'margin:35px auto -15px auto';} elseif ($scrwidth > 1280){$artemargin2 = 'margin:25px auto -15px auto';}
	//echo $scrwidth;

	echo '<style type="text/css">
	body {background-image: url(\'data:image/svg+xml;base64,\');background-position: center top;background-repeat: no-repeat;background-size: 950px 330px;}
	.login h1 a {width:200px;background-image: url(\'data:image/svg+xml;base64,\') !important;background-size: 200px 65px;'.$artemargin2.';}
	p a:hover{color:#FC6600 !important;}
	input:focus {border-color:#FC6600 !important;-webkit-box-shadow:0 0 2px rgba(252,102,0,.6) !important;box-shadow:0 0 2px rgba(252,102,0,.6) !important;}
	</style>';
}
add_action('login_head', 'artefactum_login');